          <Grid item>
            <Typography variant="subtitle1" align="center">
              My Github!
            </Typography>
          </Grid>
        </Grid>
      </Link>
      <LinkItem/> */}
      {links.map(item => 
        <LinkItem 
        label= {item.label}
        link= {item.link}
        icon= {item.icon}
        />)}

    </footer>
  );
}
  export { Footer }
